import React, { useState } from 'react';

interface HeaderProps {
    title?: string;
}

const Header: React.FC<HeaderProps> = (props) => {
    const [count, setCount] = useState(0);
    function handleClick() {
        setCount(count + 1);
    }

    return (
        <header>
            <h1>{count}</h1>
        </header>
    );
}

export default Header;
